import styled from "styled-components"

export const Container = styled.footer `

    width: 100%;
    height: 2rem;
    display: flex;
    justify-content: space-around;


    div {
        display: flex;
        margin: auto;
        width: 100%


    }

    img {
        width: 2.25rem;
        height: 2.25rem;
        border-radius: 50%;
    }

`;
